I am trying to change the background color of an adaptive card in bot framework. I have tried the following code but it is not working.

```
{
  "type": "AdaptiveCard",
  "body": [
    {
      "type": "TextBlock",
      "text": "Hello World",
      "color": "Blue"
    }
  ]
}
```

## Answer (1)

You can use the `style` property to change the background color of the card. Here is an example:

```
{
  "type": "AdaptiveCard",
  "style": "emphasis",
  "body": [
    {
      "type": "TextBlock",
      "text": "Hello World"
    }
  ]
}
```

You can find more information about the `style` property in the Adaptive Card documentation.

